import numpy as np


DB_NAME = 'test-db.db'

engine = create_engine('sqlite:///test-db.db')
Session = sessionmaker(bind=engine)
session = Session()

Base = declarative_base()

class User(Base):
    __tablename__ = 'user'

    id = Column(Integer, primary_key=True)
    name = Column(String(50))
    signature = Column(String)

